import React from 'react'

const Messagebar = () => {
  return (
    <>
      <div className='font-inter bg-[#FFFFFF] w-full h-80 rounded-[35px] flex flex-col shadow'>
        <div className='text-[#4A4A4A]'>Messages</div>
        <div></div>
        <div></div>
      </div>
    </>
  )
}

export default Messagebar
